exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`http://www.biqugewu.net/${bid.idPrefix()}_${bid}/`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"},preprocess:raw=>raw.replace(/<div style="[^>]+><table id="ad[^>]+><tr>(\s*<td id="ad.+<\/td>)+\s*<\/tr>\s*<\/table>\s*<\/div>/,"")})};